import "./App.css";
import Box from "@mui/material/Box";
import OnBoarding from "./pages/OnBoarding";
import styled from "@emotion/styled";
import { THEME } from "./constants/Theme";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import LogIn from "./pages/LogIn";
import RegisterPhase1 from "./pages/register/RegisterPhase1";
import RegisterPhase2 from "./pages/register/RegisterPhase2";
import Home from "./pages/Home";
import Payment from "./pages/Payment";
import PaymentGateway from "./pages/PaymentGateway";
import Location from "./pages/location/LocationChange";
import LocationList from "./pages/location/LocationList";
import Voucher from "./pages/Voucher";
import Product from "./pages/Product";
import Point from "./pages/Point";
import Checkout from "./pages/Checkout";
import Shipment from "./pages/Shipment";
import Profile from "./pages/Profile";
import { UserContext } from "./UserContext";
import React, { createContext, useEffect, useMemo, useState } from "react";
import axios from "axios";

const CustomizedSize = styled(Box)({
  backgroundColor: THEME.WHITE,
  minWidth: 445,
  height: "100vh",
  display: "flex",
  justifyContent: "center",
});

const Center = styled(Box)({
  display: "flex",
  justifyContent: "center",
  backgroundColor: THEME.WHITE_SECONDARY,
  height: '100%',
  overflow: "hidden"
});

export function API({num}){
  // useState React hook
  const [res, setRes] = useState([]);

  // useState React hook
  useEffect(() => { 
    getAPI();
  }, [])

  const getAPI = async () => {
    const response = await axios.get("http://localhost:8080/customers");
    setRes(response.data[0]);
    console.log("LOAD DATA INI WOYY" + res)
  };

  return res
}

export const AppContext = createContext(null)

export const AppProvider = props => (
  <AppContext.Provider value={{...API(2)}}>
    {props.children}
  </AppContext.Provider>
)

function App() {
  const [user, setUser] = useState([])

  const providerValue = useMemo(() => ({user, setUser}, [user, setUser]))

  return (
    <BrowserRouter>
      <Center>
        <CustomizedSize>
        <AppProvider >
          <Routes>
            <Route path="/" element={<OnBoarding />} />
            <Route path="/login" element={<LogIn />} />
            <Route path="/register-phase-1" element={<RegisterPhase1 />} />
            <Route path="/register-phase-2" element={<RegisterPhase2 />} />
            <Route path="/home" exact element={<Home />} />
            <Route path="/payment" element={<Payment />} />
            <Route path="/paymentgateway" element={<PaymentGateway />} />
            <Route path="/changelocation" element={<Location />} />
            <Route path="/locationlist" element={<LocationList />} />
            <Route path="/voucher" element={<Voucher />} />
            <Route path="/product" element={<Product />} />
            <Route path="/point" element={<Point />} />
            <Route path="/checkout" element={<Checkout />} />
            <Route path="/shipment" element={<Shipment />} />
            <Route path="/profile" element={<Profile />} />
          </Routes>
          </AppProvider>
        </CustomizedSize>
      </Center>
    </BrowserRouter>
  );
}

export default App;
